from typing import List
class Solution:
    def increasingTriplet(self, nums: List[int]) -> bool:
        l = len(nums)
        if l < 3:
            return False

        i = 0
        while i < l:
            j = i
            while j < l:
                if nums[i] >= nums[j]:
                    j = j + 1
                    continue
                z = j
                while z < l:
                    if  nums[j] < nums[z]:
                        return  True
                    z = z +1
                j = j + 1
            i = i + 1

        return False


if __name__ == "__main__":
    s = Solution()
    print(s.increasingTriplet(nums))




